                    <div class="tab-pane   in active" id = "tab1" >


                        <html><head><meta charset="utf-8"></head><body>
<p>Четвероногий гурман &ldquo;Golden line Мусс&rdquo; для кошек и котят с 1 месяца &ndash; это влажный корм суперпремиум класса, в составе которого только мясо и сливочный соус. Такое сочетание придает корму неповторимый вкус и привлекательную кремовую текстуру. Благодаря этому консервы хорошо поедаются и легко усваиваются, а при добавлении их в другой корм &ndash; улучшают поедаемость и усвояемость всего рациона. Все ингредиенты муссов относятся к категории Human grade (пригодны в пищу человеку). Корм полностью натуральный &ndash; в его составе нет искусственных красителей, ароматизаторов, усилителей вкуса и ГМО.</p>
<p>Уникальная рецептура &ldquo;Golden line Мусс&rdquo; разработана для прикорма самых маленьких котят от 1 месяца. Благодаря мягкой консистенции котята могут просто слизывать корм. Также мусс рекомендуется добавлять в пищу беременных и кормящих кошек, так как он увеличивает поедаемость и усвояемость всего рациона, что способствует более обильному выделению молока. Подсолнечное масло в составе является источником незаменимых жирных кислот, которые особенно важны для котят и лактирующих кошек.</p>
<p>Помимо этого, муссы можно давать и взрослым животным, например, привередливым питомцам или кошкам с проблемным пищеварением и при отсутствии зубов.</p>
</body></html>

