<p><strong>Пищевая ценность (в 100 г продукта):</strong> протеин &ndash; 6 г, жир &ndash; 8,8 г, клетчатка &ndash; 0,5 г, зола &ndash; 2 г, влага &ndash; 85 г, таурин &ndash; 0,2 г.</p>
<p><strong>Минеральные вещества (в 100 г продукта):</strong> P &ndash; 74 мг, Ca &ndash; 18 мг, Na &ndash; 144 мг, Cl &ndash; 197 мг, K &ndash; 124 мг, Mg &ndash; 12 мг, Fe &ndash; 1 мг, Cu &ndash; 55 мкг, Co &ndash; 1,9 мкг, Mn &ndash; 55 мкг, I &ndash; 1,9 мкг.</p>
<p><strong>Витамины (в 100 г продукта):</strong> Е &ndash; 1,12 МЕ, В1 &ndash; 0,02 мг, В2 &ndash; 0,05 мг, В3 &ndash; 1,19 мг, В5 &ndash; 0,11 мг, В6 &ndash; 0,07 мг.</p>
<p><strong>Энергетическая ценность (на 100 г):</strong> 112 ккал.</p>
